	function getLayerInfo(id,status,label) {
		var onOrOff = "off";
		var checkVal = false;

		if (status) {
			onOrOff = "on";
			checkVal = true;
		}

		//alert(id);
		//alert(id.indexOf("datanamessss"));
		//document.getElementById("inputchange").firstChild.nodeValue = "You just turned layer '"+label+"' "+onOrOff+"!";

		if(id=="kejian0" || id=="kejian1" || id=="kejian2" || id=="kejian3" || id=="kejian4" || id=="kejian5" || id=="kejian6")
		{
			var tmp = id.split("kejian");
			window.parent.layControl(tmp[1],checkVal);
		}
		else if(id.indexOf("dataname") >= 0)
		{
			var tmp2 = id.split("dataname");
			var index = tmp2[1];
			//alert(index);
			gSvg46_ckBoxStatus[index] = checkVal;
		}


	}		

	function removeCheckBox(optype) 
	{

		if(optype=="gSvg16")//图层控制
		{
			var gCkBoxName_kejian ;
			var gCkBoxName_bianji ;
			var gCkBoxName_xuanze ;

			//alert( "remove gSvg16_ckBox_str : " + gSvg16_ckBox_str);	
			if(gSvg16_ckBox_str=="")
				return true;

			var tmp = gSvg16_ckBox_str.split(",");
			//alert("remove length : " + tmp.length);

			for(var i=0; i < tmp.length; i++)//mywork.js---layer_scale 中值的范围是0 ~ 6
			{
				gCkBoxName_kejian = "kejian" + tmp[i];
				gCkBoxName_bianji = "bianji" + tmp[i];
				gCkBoxName_xuanze = "xuanze" + tmp[i];

				//kejian checkbox
				if (gSvg16_ckBoxArr[gCkBoxName_kejian].exists == true) 
				{
					gSvg16_ckBoxArr[gCkBoxName_kejian].remove();
				}
				//bianji checkbox
				if (gSvg16_ckBoxArr[gCkBoxName_bianji].exists == true) 
				{
					gSvg16_ckBoxArr[gCkBoxName_bianji].remove();
				}
				//xuanze checkbox
				if (gSvg16_ckBoxArr[gCkBoxName_xuanze].exists == true) 
				{
					gSvg16_ckBoxArr[gCkBoxName_xuanze].remove();
				}

			}
		}//图层控制 end

	}



